import React from 'react'
import Banner from '@/components/banner'
// import {FormattedMessage} from 'react-intl'

export default class Index extends React.Component {

  render () {
    return (
      <>
        <Banner />
        <section>
          <div className="w product">
            <div className="card">
              <p>品牌认证+短信赋能</p>
              <p>智能短信公众号</p>

            </div>
          </div>
        </section>
      </>
    )
  }
}
